import React, {Component} from 'react'
import {Text,View} from 'react-native'

function Aluno(){
    return(
        <View>
            <Text style={{color:'pink', fontWeight:'bold'}}>Lethíssia Carvalho Sousa</Text>
            <Text style={{color:'pink', fontWeight:'bold'}}>21 anos</Text>
            <Text style={{color:'pink', fontWeight:'bold'}}>Fortaleza, Ceará</Text>
            <Text style={{color:'pink', fontWeight:'bold'}}>Design Digital</Text>
        </View>
    )
}

export default Aluno
